// src/AdminExits.js
import React, { useState, useEffect } from 'react';
import './AdminExits.css';

function AdminExits({ userId }) {
  const [vehicles, setVehicles] = useState([]);
  const [exits, setExits] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [error, setError] = useState('');
  const [paymentMethod, setPaymentMethod] = useState('');

  // ✅ Araçları ve çıkışları çekme
  const fetchVehicles = async () => {
    try {
      const response = await fetch('/api/cikis');
      const data = await response.json();
      setVehicles(data.vehicles);
      setExits(data.exits);
    } catch (err) {
      console.error('Araç verileri çekilirken hata:', err);
      setError('Araç verileri çekilirken bir hata oluştu.');
    }
  };

  useEffect(() => {
    fetchVehicles();
  }, []);

  // ✅ Çıkış işlemi
  const handleExit = async (giris_ID) => {
    if (!paymentMethod) {
      setError('Lütfen bir ödeme yöntemi seçin.');
      return;
    }

    try {
      const response = await fetch('/api/cikis', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ giris_ID, paymentMethod }),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Çıkış işlemi gerçekleştirilemedi.');
      }

      setPaymentMethod('');
      fetchVehicles(); // Verileri güncelle
    } catch (err) {
      console.error('Çıkış işlemi sırasında hata:', err);
      setError(err.message);
    }
  };

  // ✅ Filtreleme
  const filteredVehicles = vehicles.filter(vehicle =>
    vehicle.arac_plaka.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="admin-exits-container">
      <div className="left-panel">
        <h2>İçerideki Araçlar</h2>
        <input
          type="text"
          placeholder="Araç plakasıyla ara"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />

        {error && <div className="error">{error}</div>}

        <table>
          <thead>
            <tr>
              <th>Plaka</th>
              <th>Giriş Saati</th>
              <th>Otopark Yeri</th>
              <th>Çıkış</th>
            </tr>
          </thead>
          <tbody>
            {filteredVehicles.length > 0 ? (
              filteredVehicles.map((vehicle) => (
                <tr key={vehicle.giris_ID}>
                  <td>{vehicle.arac_plaka}</td>
                  <td>{new Date(vehicle.giris_saat).toLocaleString()}</td>
                  <td>{vehicle.yer_ad}</td>
                  <td>
                    <select onChange={(e) => setPaymentMethod(e.target.value)}>
                      <option value="">Ödeme Seçiniz</option>
                      <option value="kart">Kart</option>
                      <option value="nakit">Nakit</option>
                    </select>
                    <button onClick={() => handleExit(vehicle.giris_ID)}>Çıkış Yap</button>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4">Araç bulunamadı</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>

      <div className="right-panel">
        <h2>Çıkış Yapan Araçlar</h2>
        <table>
          <thead>
            <tr>
              <th>Plaka</th>
              <th>Çıkış Saati</th>
              <th>Ödeme Yöntemi</th>
              <th>Ücret</th>
            </tr>
          </thead>
          <tbody>
            {exits.length > 0 ? (
              exits.map((exit) => (
                <tr key={exit.cikis_ID}>
                  <td>{exit.arac_plaka}</td>
                  <td>{new Date(exit.cikis_saati).toLocaleString()}</td>
                  <td>{exit.odeme_yontemi}</td>
                  <td>{exit.ucret} TL</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4">Henüz çıkış yapan araç bulunmamaktadır.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AdminExits;
